import React from "react";
import BookmarkAddedIcon from '@mui/icons-material/BookmarkAdded';
import DisabledByDefaultIcon from '@mui/icons-material/DisabledByDefault';

function EditNote(){



    return <div>
        <form className="create-note">
            <input 
                name="title" 
                onChange={handleChange}
                placeholder="Title" 
                value={note.title} 
            />
            <textarea 
                name="content" 
                onChange={handleChange}
                placeholder="write your note here!" 
                value={note.content} 
                rows="3" 
            />
            <button onClick={submitNote}><BookmarkAddedIcon style={{ fontSize: '40px' }}/></button>
            <button onClick={cancelNote}><DisabledByDefaultIcon style={{ fontSize: '40px' }}/></button>
        </form>
    </div>
}
export default EditNote;
